import Head from "./components/Head";
import Body from "./components/Body";
import Footer from "./components/Footer";
import "./css/styles.css";
import "./css/variables.css";
import React from "react";

function App() {
  return (
    <React.Fragment>
      <html>
        <Head />
        <Body />
      </html>
      <Footer />
    </React.Fragment>
  );
}

export default App;
